import datetime
import calendar
def get_day_name(day):
    return calendar.day_name[day]
def get_timestamp(time):
    return datetime.datetime.strptime(time, "%H:%M")
def get_minutes(time):
    return time.hour * 60 + time.minute
def get_next_timestamp(time, interval):
    return get_timestamp(time) + datetime.timedelta(minutes=interval)
def get_next_minutes(time, interval):
    return get_minutes(get_next_timestamp(time, interval))
def get_next_day_name(day):
    return get_day_name((day + 1) % 7)
def get_next_day(timestamp):
    return (timestamp + datetime.timedelta(days=1)).weekday()
def get_next_same_minute(timestamp1, interval1, timestamp2, interval2):
    timestamp1 = get_timestamp(timestamp1)
    interval1 = get_minutes(interval1)
    timestamp2 = get_timestamp(timestamp2)
    interval2 = get_minutes(interval2)
    while get_minutes(timestamp1) != get_minutes(timestamp2):
        timestamp1 = get_next_timestamp(timestamp1, interval1)
    return timestamp1
def main():
    timestamp1 = input()
    timestamp2 = input()
    interval1 = input()
    interval2 = input()
    timestamp1 = get_next_same_minute(timestamp1, interval1, timestamp2, interval2)
    if timestamp1 is None:
        print("Never")
        return
    day = get_next_day_name(get_next_day(get_timestamp(timestamp1).weekday()))
    print(day)
    print(timestamp1.strftime("%H:%M"))
