MOD = 1000000007

def factorial(n):
    if n == 0:
        return 1
    return (n * factorial(n - 1)) % MOD

def combination(n, r):
    return (factorial(n) * pow(factorial(r), MOD - 2, MOD) * pow(factorial(n - r), MOD - 2, MOD)) % MOD

def solve(n, colors, forbidden, sequence):
    if len(sequence) == 0:
        return 1
    if len(colors) == 0:
        return 0
    if colors[0] in forbidden:
        return solve(n, colors[1:], forbidden, sequence)
    else:
        return (solve(n, colors[1:], forbidden, sequence) + solve(n, colors[1:], forbidden, sequence[1:] + [colors[0]])) % MOD

