    return dist(x1, y1, x2, y2) / speed(vx + wx, vy + wy)

def time2(vx, vy, wx, wy, x1, y1, x2, y2):
    return dist(x1, y1, x2, y2) / speed(vx, vy) + t / speed(wx, wy)

